    const { Header, Content, Footer } = Layout;

    return (    
        <Layout>
            <h2>Menu Sider Basic</h2>
            <div>Contenido.....</div>
            <Footer>mailto: agutierrez.pers@gmail.com</Footer>
            <h5>Footer...</h5>
        </Layout>
    );
}
